import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import HeadingWithList from './components/HeadingWithList';


function App() {
  return(<Router>
    <Switch>
      <Route exact path="/:id" children={<HeadingWithList type="To do List" typePlaceholder="Add New Tasks"/>} />
      <Route path="/" children={<HeadingWithList type="Bucket List" typePlaceholder="Add New BucketList"/>} />
    </Switch>
  </Router>
  )
}

export default App;
